import React from 'react'

function LiquorCategory({props}) {

  return (
    <div className='component liquors'>
        {
           props.map(obj => (

                <main id='liquor' key={obj.id}>
                    <img src={obj.image} alt={obj.title} />
                    <p> 
                        <span st>Ksh. {obj.price}</span><br />
                        {/* Rating : {obj.rating}/5  */}
                        <b>{obj.title}</b><br />
                        {obj.description} <br />
                    </p>
                </main>
            )) 
        }
    </div>
  )
}

export default LiquorCategory
